import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

const Header = () => {
  return (
  <>
  <Navbar bg="primary" data-bs-theme="dark">
    <Container>
      <Navbar.Brand href="#home">Who am I </Navbar.Brand>
      <Nav className="me-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#Hobbiess">Favorite Hobbiess</Nav.Link>
        <Nav.Link href="#Personality">Favorite Personality</Nav.Link>
        <Nav.Link href="#Cities">Favorite Cities</Nav.Link>
        <Nav.Link href="#contact-info">Contact Info</Nav.Link>
        

      </Nav>
    </Container>
  </Navbar>
  </>
  )
}

export default Header
